import { Component, inject, OnInit } from '@angular/core';
import { CommonModule } from '@angular/common';
import { FormsModule } from '@angular/forms';
import { IonicModule } from '@ionic/angular';
import { GfncService } from '../services/gfnc.service';
import { Gfnc } from '../interfaces/gfnc';

@Component({
  selector: 'app-gfnc',
  templateUrl: './gfnc.page.html',
  styleUrls: ['./gfnc.page.scss'],
  standalone: true,
  imports: [IonicModule, CommonModule, FormsModule]
})
export class GfncPage implements OnInit {

  gfncall: Gfnc[] =[]

  gfncService = inject(GfncService)

  async ngOnInit() {
    try {
      const response = await this.gfncService.getAll();
      this.gfncall = response.gfnc; // Extrae el array de la propiedad 'gfnc'
    } catch (error) {
      console.error('Error al cargar los datos:', error);
    }
  }


}
<ion-header [translucent]="true">
  <ion-toolbar>
    <ion-buttons slot="start">
      <ion-back-button default-href="main"></ion-back-button>
    </ion-buttons>
    <ion-title>GFNC</ion-title>
  </ion-toolbar>
</ion-header>

<ion-content [fullscreen]="true">
  <ion-header collapse="condense">
    <ion-toolbar>
      <ion-title size="large">GFNC</ion-title>
    </ion-toolbar>
  </ion-header>

  <ion-list>
    @for (gfnc of gfncall; track gfnc.id) {
      <ion-item>
        <ion-thumbnail>
          <img [src]="gfnc.image" [alt]="gnfc.name">
        </ion-thumbnail>
        <ion-label>
          <h2>{{gfnc.name}}</h2>
        </ion-label>
      </ion-item>
    }
  </ion-list>
</ion-content>
